INSERT INTO `bb_aggregation_method` VALUES ('23eeecb4-6a6c-4d06-92fb-5d702ab53b06', 'MAX_001', 'Max', 'GROOVY', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nscore = AggregationMethod.build().max(kpi);\n', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nAggregationMethod.build().maxDateRange(kpi, frequency);\n', 'get max score!', 'admin', '2015-03-12 12:16:19', 'admin', '2017-01-11 22:01:48');
INSERT INTO `bb_aggregation_method` VALUES ('422456ae-a8da-4337-a26e-82d108abf86d', 'CNT_002', 'Count Dist (count distinct)', 'GROOVY', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nscore = AggregationMethod.build().countDistinct(kpi);\n', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nAggregationMethod.build().countDistinctDateRange(kpi, frequency);\n', 'For example, the count of (1, 1, 2, 3) is 4, but the distinct count of (1, 1, 2, 3) is 3.', 'admin', '2015-04-22 14:51:07', 'admin', '2017-01-11 21:43:55');
INSERT INTO `bb_aggregation_method` VALUES ('627ffc6c-c24d-4bf7-a7fa-02c2c7ec03fa', 'AVG_002', 'Avg Dist (average distinct)', 'GROOVY', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nscore = AggregationMethod.build().averageDistinct(kpi);\n', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nAggregationMethod.build().averageDistinctDateRange(kpi, frequency);\n', 'For example, the average of (10, 10, 20) is 40/3, but the distinct average of (10, 10, 20) is 30/3.', 'admin', '2015-04-22 14:39:02', 'admin', '2017-01-11 21:10:36');
INSERT INTO `bb_aggregation_method` VALUES ('72399a9c-8e2f-4ca1-ba49-baae21f50526', 'SUM_002', 'Sum Dist (sum distinct)', 'GROOVY', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nscore = AggregationMethod.build().sumDistinct(kpi);\n', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nAggregationMethod.build().sumDistinctDateRange(kpi, frequency);\n', 'For example, the sum of (10,10) is 20, but the distinct sum of (10,10) is 10.', 'admin', '2015-04-22 14:21:18', 'admin', '2017-01-11 22:41:26');
INSERT INTO `bb_aggregation_method` VALUES ('8027026c-77bc-497e-bb44-1cf9e98a1570', 'SUM_001', 'Sum', 'GROOVY', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nscore = AggregationMethod.build().sum(kpi);\n', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nAggregationMethod.build().sumDateRange(kpi, frequency);\n', 'for Sum!', 'admin', '2015-03-11 09:04:13', 'admin', '2017-01-11 22:26:55');
INSERT INTO `bb_aggregation_method` VALUES ('abc66064-41c9-4d30-9f2a-b7cee9bedd3e', 'AVG_001', 'Average', 'GROOVY', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nscore = AggregationMethod.build().average(kpi);\n', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nAggregationMethod.build().averageDateRange(kpi, frequency);\n', 'for Average!', 'admin', '2015-03-11 09:05:24', 'admin', '2017-01-11 20:44:07');
INSERT INTO `bb_aggregation_method` VALUES ('ce7ea3a2-c9af-4ffc-bd3d-eeca557874da', 'MIN_001', 'Min', 'GROOVY', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nscore = AggregationMethod.build().min(kpi);\n', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nAggregationMethod.build().minDateRange(kpi, frequency);\n', 'get min score!', 'admin', '2015-03-12 12:15:47', 'admin', '2017-01-11 22:14:41');
INSERT INTO `bb_aggregation_method` VALUES ('d416ea4c-8f64-47a3-a56c-ade0f86006b5', 'CNT_001', 'Count', 'GROOVY', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nscore = AggregationMethod.build().count(kpi);\n', 'import com.netsteadfast.greenstep.bsc.util.*;\n\nAggregationMethod.build().countDateRange(kpi, frequency);\n', 'returns the count records of measure data. \nDoes not require the calculation formula.', 'admin', '2015-04-22 13:59:41', 'admin', '2017-01-11 21:28:33');
