INSERT INTO `bb_formula` VALUES ('1339c964-a49e-47cc-bef6-51c4c479759a', 'FKH032017_C1-3', 'Khch hng - C1-3 - 032017', 'BSH', 'N', 'C', 'ans', 'import org.apache.commons.lang3.math.*;\nimport java.lang.*;\n\nproportion = actual/target*100;\nif ( proportion < 98 ) {\n    ans = 1;\n    return ans;\n}\nelse if ( proportion < 98.5 ) {\n		ans = 2;\n		return ans;\n	}\n	else if ( proportion < 99.8 ) {\n		ans = 3;\n		return ans;\n		}\n		else if ( proportion < 99.5 ) {\n			ans = 4;\n			return ans;\n			}\n			else if ( proportion = 100 ) {\n					ans = 5;\n					return ans;\n				}\n}', 'Hm dnh cho mc tiu:  Duy tr thu bao MyTV hin hu (C1.3)', 'admin', '2017-06-12 14:03:44', null, null);
INSERT INTO `bb_formula` VALUES ('1836c69d-90f0-404f-94dd-f8e3ebc94708', 'FKH032017_C1-1', 'Khch hng - C1-1 - 032017', 'BSH', 'N', 'C', 'ans', 'import org.apache.commons.lang3.math.*;\nimport java.lang.*;\n\nproportion = actual/target*100;\nif ( proportion < 99.5 ) {\n    ans = 1;\n    return ans;\n}\nelse if ( proportion < 99.7 ) {\n		ans = 2;\n		return ans;\n	}\n	else if ( proportion < 99.8 ) {\n		ans = 3;\n		return ans;\n		}\n		else if ( proportion < 100 ) {\n			ans = 4;\n			return ans;\n			}\n			else if ( proportion == 100 ) {\n					ans = 5;\n					return ans;\n				}\n}', 'Hm dnh cho mc tiu:  Duy tr thu bao FiberVNN hin hu (C1.1)\n', 'admin', '2017-06-12 14:01:45', 'admin', '2017-06-14 09:00:42');
INSERT INTO `bb_formula` VALUES ('3abe4cd2-8d87-4c67-9a33-a76172ecf1a4', 'FTC032017_C3', 'Khch hng - C3 -  032017', 'BSH', 'N', 'C', 'ans', 'import org.apache.commons.lang3.math.*;\nimport java.lang.*;\n\nproportion = actual/target*100;\nif ( proportion == 0 ) {\n    ans = 0;\n    return ans;\n}\nelse if ( proportion < 33.33 ) {\n		ans = 1;\n		return ans;\n	}\n	else if ( proportion < 66.67 ) {\n		ans = 2;\n		return ans;\n		}\n		else if ( proportion >= 100 ) {\n			ans = 5;\n			return ans;\n			}', 'Hm dnh cho mc tiu: Thu thp bin bn bn giao dch v CNTT vi khch hng (HIS, CPT) (C3)', 'admin', '2017-06-12 14:21:55', null, null);
INSERT INTO `bb_formula` VALUES ('50af58c5-5503-4b6a-af11-1fddce88080c', 'FKH032017_C1-2', 'Khch hng - C1-2 - 032017', 'BSH', 'N', 'C', 'ans', 'import org.apache.commons.lang3.math.*;\nimport java.lang.*;\n\nproportion = actual/target*100;\nif ( proportion < 95 ) {\n    ans = 1;\n    return ans;\n}\nelse if ( proportion < 110 ) {\n		ans = 2 + 0.2*(proportion-95);\n		ans = NumberUtils.toFloat( String.valueOf(ans), 0.0f);\n		return ans;\n	}\n	else{\n		ans = 5;\n		return ans;\n	}\n}\n', 'Hm dnh cho mc tiu:  Thu bao FiberVNN pht trin mi + chuyn i (C1.2)', 'admin', '2017-06-12 14:06:02', null, null);
INSERT INTO `bb_formula` VALUES ('605aee32-2921-475f-a4d3-22d83a07e506', 'FTC032017_F2', 'Ti chnh - F2 - 032017', 'BSH', 'N', 'C', 'ans', 'import org.apache.commons.lang3.math.*;\nimport java.lang.*;\n\nproportion = actual/target*100;\nif ( proportion < 30 ) {\n    ans = 0.5;\n    return ans;\n}\nelse if ( proportion < 40 ) {\n		ans = 1;\n		return ans;\n	}\n	else if ( proportion < 50 ) {\n		ans = 1.5;\n		return ans;\n		}\n		else if ( proportion < 60 ) {\n			ans = 2;\n			return ans;\n			}\n			else if ( proportion < 70 ) {\n					ans = 2.5;\n					return ans;\n				}\n				else if ( proportion < 80 ) {\n						ans = 3;\n						return ans;\n					}\n					else if ( proportion < 90 ) {\n							ans = 3.5;\n							return ans;\n						}\n						else if ( proportion < 100 ) {\n							ans = 4;\n							return ans;\n						}\n						else if ( proportion < 105 ) {\n								ans = 4.5;\n								return ans;\n							}\n							else if ( proportion >= 105 ) {\n									ans = 5;\n									return ans;\n								}\n}\n', 'Hm dnh cho mc tiu:  Tng trng doanh thu CNTT (F2)\n', 'admin', '2017-06-12 13:56:38', 'admin', '2017-06-12 14:15:20');
INSERT INTO `bb_formula` VALUES ('8d21b81c-f948-489a-a949-2a80f505b9f9', 'FKH032017_C1-4', 'Khch hng - C1-4 - 032017', 'BSH', 'N', 'C', 'ans', 'import org.apache.commons.lang3.math.*;\nimport java.lang.*;\n\nproportion = actual/target*100;\nif ( proportion < 95 ) {\n    ans = 1;\n    return ans;\n}\nelse if ( proportion < 110 ) {\n		ans = 2 + 0.2*(proportion-95);\n		ans = NumberUtils.toFloat( String.valueOf(ans), 0.0f);\n		return ans;\n	}\n	else{\n		ans = 5;\n		return ans;\n	}\n}\n', 'Hm dnh cho mc tiu:  Thu bao MyTV pht trin mi (C1.4)', 'admin', '2017-06-12 14:11:44', null, null);
INSERT INTO `bb_formula` VALUES ('a37a9334-1171-4b63-a562-d505e19dca42', 'FTC032017_C2', 'Khch hng - C2 -  032017', 'BSH', 'N', 'C', 'ans', 'import org.apache.commons.lang3.math.*;\nimport java.lang.*;\n\nproportion = actual/target*100;\nif ( proportion == 0 ) {\n    ans = 0;\n    return ans;\n}\nelse if ( proportion < 33.33 ) {\n		ans = 1;\n		return ans;\n	}\n	else if ( proportion < 66.67 ) {\n		ans = 2;\n		return ans;\n		}\n		else if ( proportion >= 100 ) {\n			ans = 3;\n			return ans;\n			}', 'Hm dnh cho mc tiu: Ci c dch v CNTT (HIS, Chnh ph in t) (C2)', 'admin', '2017-06-12 14:20:34', null, null);
INSERT INTO `bb_formula` VALUES ('b58b87cc-e938-4538-9617-4656788492cb', 'F777', 'KPI trends change(%)', 'BSH', 'Y', 'C', 'ans', 'if ( (float)cv!=0.0 && (float)pv!=0.0 ) {\n    ans = ( cv  pv - 1 )  100.0;\n    return;\n}\nif ( (float)cv==0.0 ) {\n    ans = pv * -1.0;   \n    return;\n}\nif ( (float)pv==0.0 ) {\n    ans = cv;\n    return;\n}\nans = 0.0;\n\n', 'for KPI peroid current/previous score change(%)', 'admin', '2015-10-15 16:09:02', 'admin', '2015-10-17 12:18:19');
INSERT INTO `bb_formula` VALUES ('b6eab5b8-ec47-403a-9ea9-9e6bd7bd1841', 'FNB032017', 'Ni b - 032017', 'BSH', 'N', 'C', 'ans', 'import org.apache.commons.lang3.math.*;\nimport java.lang.*;\n\nproportion = actual/target*100;\nif ( proportion < 93 ) {\n    ans = 1;\n    return ans;\n}\nelse if ( proportion < 96 ) {\n		ans = 2;\n		return ans;\n	}\n	else if ( proportion < 100 ) {\n		ans = 3;\n		return ans;\n		}\n		else if ( proportion < 105 ) {\n			ans = 4;\n			return ans;\n			}\n			else if ( proportion >= 105 ) {\n					ans = 5;\n					return ans;\n				}', '', 'admin', '2017-06-14 07:44:44', null, null);
