INSERT INTO `bb_formula` VALUES ('d382b6ab-fe55-4c93-8c8e-79896ed09f7a', 'F001', 'F001 percent of target', 'GROOVY', 'N', 'C', 'ans', 'import org.apache.commons.lang3.math.*;\nimport java.lang.*;\n\nif (actual > 0 && target > 0 ) {\n    ans = Math.max( actual  target ,  0 )  100;\n    ans = NumberUtils.toFloat( String.valueOf(ans), 0.0f);\n    return ans;\n}\nif (\n    (actual <= 0 && target < 0 && actual >= target)\n    ||\n    (actual <= 0 && target < 0 && actual < target)\n    ||\n    (actual > 0 && target < 0 )\n) {\n    ans = ((((target - actual)  target)  100) + 100);\n    ans = NumberUtils.toFloat( String.valueOf(ans), 0.0f);\n    return ans;\n}\nif (actual < 0 && target > 0 ) {\n    ans = ((((actual - target)  target)  100) + 100);\n    ans = NumberUtils.toFloat( String.valueOf(ans), 0.0f);\n    return ans;\n}\nif (actual == 0 && target > 0 ) {\n    ans = 0;\n    ans = NumberUtils.toFloat( String.valueOf(ans), 0.0f);\n    return ans;\n}\nif (actual >= 0 && target == 0 ) {\n    ans = ((actual  100) + 100);\n    ans = NumberUtils.toFloat( String.valueOf(ans), 0.0f);\n    return ans;\n}\nif (actual < 0 && target == 0 ) {\n    ans = ((actual  100) + 100);\n    ans = NumberUtils.toFloat( String.valueOf(ans), 0.0f);\n    return ans;\n}\nans = 0;\nans = NumberUtils.toFloat( String.valueOf(ans), 0.0f);\nreturn ans;', 'Calculating percent of target.', 'admin', '2014-11-19 11:39:03', 'admin', '2017-06-12 11:05:15');
