INSERT INTO `tb_sys_expression` VALUES ('79cf3dcb-1346-46c6-9ed5-bd17debf9502', 'BSC_KPI_EXPR0002', 'BSH', 'KPI create success message plus!', 'if (resultObj==null || !(resultObj instanceof com.netsteadfast.greenstep.base.model.DefaultResult ) ) {\n	return;\n}\nif (resultObj.getValue()==null || resultObj.getSystemMessage().getValue()==null ) {\n	return;\n}\nresultObj.setSystemMessage(\n	new com.netsteadfast.greenstep.base.model.SystemMessage(\n		resultObj.getSystemMessage().getValue() + \n		\"<BR/>Please to maintain measure data of the KPI.<BR/>\")\n);\n', 'message plus!', 'admin', '2014-11-23 14:27:08', 'admin', '2014-11-24 09:16:21');
